import React, { Component } from "react";
import DataService from "../Services/WebUserJobService";
import { Link } from "react-router-dom";

  export default class AllJobsList extends Component {
    constructor(props) {
      super(props);
      
      this.state = {
        categories: []
      };
    }

  componentDidMount() {
    DataService.getJobCategory().then((res) =>{
      this.setState({categories:res.data});
    });
  }

  jobCategory(id){

    DataService.getJobIndustry(
      id          
  )
      .then(response => {
          console.log(response.data);
          this.props.history.push('AllViewedJobsList')
          //window.location.reload();
      })
      .catch(e => {
          console.log(e);
      });
  }

  render(){
    const{categories} = this.state;
    return(
      <div>
        <h2 className="text-center">Jobs per Category</h2>
        <div className="row">
        
        <table className = "table table-striped table-bordered">
            <thead>
              <tr>
                <th>Job Title</th>
                <th>Job Industry</th>
                <th>Job Qualification</th>
              </tr>
            </thead>
            <tbody>
              {
                this.state.jobs.map(job => 
                <tr key = {job.jobid}>
                  <td>{job.jobTitle}</td>
                  <td>{job.jobIndustry}</td>
                  <td>{job.jobqualification}</td>
                  <td>{job.jobDescription}</td>
                  <td>{job.autismLevel}</td>
                  <td>{job.jobStarRating}</td>
                  <td>{job.jobPositionURL}</td>
                  <td>{job.companyname}</td>
                  <td>{job.companystarRating}</td>
                  <td>{job.dateViewed}</td>
                </tr>  
                  )
              }
            </tbody>
  
          </table>
        
        
        <div>
      {
        Object.keys(this.state.categories).map((key, i) => (
          <p key={i}>
            <span>Key Name: {key}</span>
            <span>Value: {this.state.categories[key]}</span>
          </p>
        ))
      }
    </div>
    
        </div>
  
      </div>
    );
  
  }

}
